member.example:
In this example, BaseType is an abstract base class, and DerivedType is a concrete class that derives from BaseType. The Fixture instance is configured to relay all requests for BasetType to requests for DerivedType, so the actual result return from the fixture when BasetType is requested is a DerivedType instance.
var fixture = new Fixture(); fixture.Customizations.Add( new TypeRelay( typeof(BaseType), typeof(DerivedType)));
var actual = fixture.Create<BaseType>();

member.remarks:
Specimens are typically either of type 
        Expression{Func{T}}

    or .

example.code:
var fixture = new Fixture();
fixture.Customize(new NumericSequencePerTypeCustomization());

Console.WriteLine("Byte specimen is {0}", fixture.Create<byte>());
Console.WriteLine("Int32 specimen is {0}", fixture.Create<int>());
Console.WriteLine("Single specimen is {0}", fixture.Create<float>());

// The output of this program will be:
// Byte specimen is 1
// Int32 specimen is 1
// Single specimen is 1
